import React from 'react';
import 'css/Leaderboard.css';
const UserRow = () => {
  return (
    <div className="user-row__container">
      <div className="user-row__ranking">1</div>
      <div className="user-row__nickname">Jason</div>
      <div className="user-row__score">99</div>
    </div>
  );
};

export default UserRow;
